import React, { Component } from 'react';
import { Icon } from 'semantic-ui-react';

class Main extends Component {

    handleGitHubClick = () => {

    }
    render() {
        return(
            <div className="main-section" id="main">
                <div className="title">
                    <p>Vadim Stakhnyuk</p>
                </div>
                <div className="subtitle">
                    <p>Software Engineer</p>
                </div>
                <div className="icons">
                    <Icon link size="huge" name="github" onClick={this.handleGitHubClick} />
                    <Icon link size="huge" name="linkedin" onClick={this.handleLinkedInClick} />
                    <Icon link size="huge" name="twitter" onClick={this.handleTwitterClick} />
                </div>
            </div>
        )
    }
}

export default Main;
